import logo from './logo.svg';
import './App.css'; 
import NavScrollExample from './navbar'
// import { Navbar } from 'react-bootstrap'; 
// import { Carousel } from 'react-bootstrap'; 
import IndividualIntervalsExample  from './carousel';

function App() {
  return ( 
    <>
      <NavScrollExample/>    
        <h4>&nbsp;</h4>
        <div className={'container'}>
          <div className={'row'}>
          <div className={'col-md-6'}> 
            <IndividualIntervalsExample/>  
          </div>
           <div className={'col-md-6'}> 
            <p name = 'text_penguin'>Penguins (order Sphenisciformes /sfɪˈnɪsɪfɔːrmiːz/, family Spheniscidae /sfɪˈnɪsɪdiː/) are a group of aquatic flightless birds. They live almost exclusively in the Southern Hemisphere: only one species, the Galápagos penguin, is found north of the Equator. Highly adapted for life in the water, penguins have countershaded dark and white plumage and flippers for swimming. Most penguins feed on krill, fish, squid and other forms of sea life which they catch with their bills and swallow it whole while swimming. A penguin has a spiny tongue and powerful jaws to grip slippery prey</p>
           </div>
          </div>
        </div>
    </>

  );
}

export default App;
